import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import GenreBar from '../components/GenreBar';
import AutorBar from '../components/AutorBar';

const Shop = () => {
  return (
    <Container >
        <Row className="mt-2">
          <Col md={3}>
            <GenreBar/>
          </Col>
          <Col md={9} className='d-flex '>
            <AutorBar/>
          </Col>

        </Row>
    </Container>
  );
}

export default Shop;
